TalComponent::~TalComponent()
{
    deleteAllChildren();
    getProcessor()->removeChangeListener (this);
}

FilmStripKnob* TalComponent::addNormalKnob(Component *component, int x, int y, TalCore* const ownerFilter, const Image knobImage, int numOfFrames, int parameter)
{
	FilmStripKnob *filmStripKnob;
	component->addAndMakeVisible(filmStripKnob = new FilmStripKnob(knobImage,
									 numOfFrames,
									 false,
                                     parameter));
    filmStripKnob->setBounds(x, y + this->synth1AccordeonTab->getTabHeight(), knobImage.getWidth(), knobImage.getHeight() / numOfFrames);
	filmStripKnob->addListener (this);
	return filmStripKnob;
}

ImageToggleButton* TalComponent::addNormalButton(Component *component, int x, int y, TalCore* const ownerFilter, const Image buttonImage, bool isKickButton, int parameter)
{
	ImageToggleButton *imageToggleButton;
	component->addAndMakeVisible(imageToggleButton = new ImageToggleButton("Toggle Button", buttonImage, false, isKickButton, parameter));
    imageToggleButton->setBounds(x, y + this->synth1AccordeonTab->getTabHeight(), buttonImage.getWidth(), buttonImage.getHeight() / 2);
	imageToggleButton->addListener(this);
	return imageToggleButton;
}

ImageSlider* TalComponent::addSlider(Component *component, int x, int y, TalCore* const ownerFilter, const Image sliderImage, int height, int parameter)
{
	ImageSlider *imageSlider;
	component->addAndMakeVisible(imageSlider = new ImageSlider(sliderImage, height, parameter));
	imageSlider->setBounds(x, y + this->synth1AccordeonTab->getTabHeight(), /*sliderImage->getWidth()*/ 40, height + sliderImage.getHeight());
	imageSlider->addListener (this);
	return imageSlider;
}

TalComboBox* TalComponent::addTalComboBox(Component *component, int x, int y, int width, TalCore* const ownerFilter, int parameter)
{
	TalComboBox *comboBox;
	component->addAndMakeVisible(comboBox = new TalComboBox(parameter));
	comboBox->setBounds(x, y + this->synth1AccordeonTab->getTabHeight(), width, 20);
	comboBox->setColour(TalComboBox::backgroundColourId, Colour((juce::uint8)8, (juce::uint8)11, (juce::uint8)58, 0.0f));
	comboBox->setColour(TalComboBox::textColourId, Colour::greyLevel(1.0f));
	comboBox->setColour(TalComboBox::buttonColourId, Colour((juce::uint8)8, (juce::uint8)11, (juce::uint8)58, 0.0f));
	comboBox->setColour(TalComboBox::arrowColourId, Colour((juce::uint8)8, (juce::uint8)11, (juce::uint8)58, 0.0f));
    comboBox->addListener (this);
	return comboBox;
}

