void TalComponent::paint (Graphics& g)
{
    // just clear the window
    g.fillAll (Colour((const uint8)44, (const uint8)40, (const uint8)40, (const uint8)255));
    // this->accordeonTabContainer->repaint();
}

void TalComponent::resized()
{
    if (this->accordeonTabContainer->getCurrentHeight() != getHeight()
        || this->accordeonTabContainer->getWidth() != getWidth())
    {
        setSize(this->accordeonTabContainer->getWidth(), 2 * this->synth2AccordeonTab->getTabHeight() + this->logoPanel->getHeight() + this->synth2AccordeonTab->getMaxHeight() + this->synth1AccordeonTab->getMaxHeight());
    }

    repaint();
}

//==============================================================================
void TalComponent::changeListenerCallback (ChangeBroadcaster* source)
{
    // this is the filter telling us that it's changed, so we'll update our
    // display of the time, midi message, etc.
    updateParametersFromFilter();
}

void TalComponent::sliderDragStarted (Slider* slider)
{
    NamedValueSet values = slider->getProperties();
    if (values.contains(Identifier("index")))
    {
        TalCore* const filter = getProcessor();
        filter->beginParameterChangeGesture(values["index"]);
    }
}

void TalComponent::sliderDragEnded (Slider* slider)
{
    NamedValueSet values = slider->getProperties();
    if (values.contains(Identifier("index")))
    {
        TalCore* const filter = getProcessor();
        filter->endParameterChangeGesture(values["index"]);
    }
}

void TalComponent::sliderValueChanged (Slider* caller)
{
    NamedValueSet values = caller->getProperties();
    if (values.contains(Identifier("index")))
    {
        TalCore* const filter = getProcessor();
        filter->setParameterNotifyingHost(values["index"], (float)caller->getValue());
    }

    this->updateInfo(caller);
}

void TalComponent::updateInfo(Slider* caller)
{
    // FIXME: Refactor
    TalCore* const filter = getProcessor();
    if (caller == osc1TuneKnob || caller == osc2TuneKnob)
    {
        infoText->setText(juce::String(audioUtils.getOscTuneValue((float)caller->getValue()), 0), dontSendNotification);
    }
    else if (caller == osc1FineTuneKnob || caller == osc2FineTuneKnob || caller == oscMasterTuneKnob)
    {
        infoText->setText(juce::String(audioUtils.getOscFineTuneValue((float)caller->getValue()), 4), dontSendNotification);
    }
    else if (caller == filterContourKnob)
    {
        infoText->setText(juce::String(audioUtils.getLogScaledLinearValueCentered((float)caller->getValue()), 2), dontSendNotification);
    }
    else if (caller == lfo1AmountKnob || caller == lfo2AmountKnob || caller == freeAdAmountKnob)
    {
        infoText->setText(juce::String(audioUtils.getLogScaledValueCentered((float)caller->getValue()), 4), dontSendNotification);
    }
    else if (caller == osc1VolumeKnob || caller == osc2VolumeKnob || caller == osc3VolumeKnob)
    {
        infoText->setText(juce::String(audioUtils.getLogScaledValueInDecibel((float)caller->getValue(), 1) , 2) + " dB", dontSendNotification);
    }
    else if (caller == volumeKnob)
    {
        infoText->setText(juce::String(audioUtils.getLogScaledValueInDecibel((float)caller->getValue(), 2) , 2) + " dB", dontSendNotification);
    }
    else if (caller == pitchwheelPitchKnob)
    {
        infoText->setText(juce::String(12.0f * (float)caller->getValue() , 2), dontSendNotification);
    }
    else if (caller == transposeKnob)
    {
        infoText->setText(juce::String(audioUtils.getTranspose((float)caller->getValue()), 2), dontSendNotification);
    }
    else if (caller == osc1PwKnob)
    {
        infoText->setText(juce::String(audioUtils.getLogScaledLinearValueCentered((float)caller->getValue()), 2), dontSendNotification);
    }
    else if (caller == lfo1RateKnob || caller == lfo2RateKnob)
    {
        float isSync = false;
        if ((filter->getParameter(LFO1SYNC) > 0.0f && caller == lfo1RateKnob) || (filter->getParameter(LFO2SYNC) > 0.0f && caller == lfo2RateKnob))
        {
            isSync = true;
        }
        if (isSync)
        {
            float value = (float)caller->getValue();
            const char* text = audioUtils.getSyncedRateAndGetText(&value, filter->getBpm());
            infoText->setText(juce::String(text), dontSendNotification);
        }
        else
        {
            infoText->setText(juce::String(audioUtils.getLogScaledRate((float)caller->getValue()), 2) + " Hz", dontSendNotification);
        }
    }
    else if (caller == delayTimeKnob)
    {
        if (filter->getParameter(DELAYSYNC) > 0.0f)
        {
            float value = (float)caller->getValue();
            const char* text = audioUtils.getDelaySyncTimeAndText(&value);
            infoText->setText(juce::String(text), dontSendNotification);
        }
        else
        {
            infoText->setText(juce::String(audioUtils.getLogScaledValue((float)caller->getValue()) * 4000.0f, 2) + " ms", dontSendNotification);
        }
    }
    else if (caller == delayFeedbackKnob)
    {
        infoText->setText(juce::String(audioUtils.getDelayFeedback(caller->getValue()), 2), dontSendNotification);
    }
    else
    {
        infoText->setText(juce::String(caller->getValue(), 2), dontSendNotification);
    }
}

void TalComponent::buttonClicked (Button* caller)
{
    NamedValueSet values = caller->getProperties();
    if (values.contains(Identifier("index")))
    {
        TalCore* const filter = getProcessor();
        filter->setParameterNotifyingHost((int)values["index"], (float)caller->getToggleState());

        // FIXME: Move following code to separate class
        if ((int)values["index"] == PRESETLOAD)
        {
            FileChooser myChooser ("Please choose a valid NoiseMaker preset.",
                                   File::getSpecialLocation (File::userHomeDirectory),
                                   "*.noisemakerpreset");

            if (myChooser.browseForFileToOpen())
            {
                File selectedFile = myChooser.getResult();

                XmlDocument myDocument(selectedFile.loadFileAsString());
                XmlElement* mainElement = myDocument.getDocumentElement();

                if (mainElement != NULL)
                {
                    filter->setStateInformationFromXml(mainElement);
                }
            }
        }

        if ((int)values["index"] == PRESETSAVE)
        {
            FileChooser myChooser("Save NoiseMaker preset.",
                                   File::getSpecialLocation(File::userHomeDirectory),
                                   "*.noisemakerpreset");

            if (myChooser.browseForFileToSave(true))
            {
                File selectedFile = myChooser.getResult();

                if (!selectedFile.getFileExtension().equalsIgnoreCase(".noisemakerpreset"))
                {
                    selectedFile = selectedFile.getFullPathName() + ".noisemakerpreset";
                }

                XmlElement* const xmlState = filter->getCurrentProgramStateInformationAsXml();
                String myXmlDoc = xmlState->createDocument("");
                selectedFile.replaceWithText(myXmlDoc);
                delete xmlState;
            }
        }
    }

    this->handleClickedTabs(caller);
}

void TalComponent::handleClickedTabs (Button* caller)
{
    TalCore* const filter = getProcessor();

    if (caller == synth1AccordeonTab
        || caller == synth2AccordeonTab
        || caller == envelopeEditorAccordeonTab
        || caller == controlAccordeonTab)
    {
        Array<AccordeonTab*> tabs = this->accordeonTabContainer->getAccordeonArray();

        int openTabCount = 0;
        for (int i = 0; i < tabs.size(); i++)
        {
            if (tabs[i]->isExpanded())
            {
                openTabCount++;
            }
        }

        int shrinkedTabs = 0;
        for (int i = tabs.size() - 1; i >= 0; i--)
        {
            if (tabs[i]->isExpanded() && tabs[i] != caller)
            {
                if (openTabCount - shrinkedTabs > 2)
                {
                    shrinkedTabs++;
                    tabs[i]->setExpanded(false);
                }
                else
                {
                    break;
                }
            }
        }

        this->accordeonTabContainer->resizeTabs(false);
        this->resized();
    }

    if (caller == synth1AccordeonTab) filter->setParameterNotifyingHost(TAB1OPEN, (float)synth1AccordeonTab->isExpanded());
    if (caller == synth2AccordeonTab) filter->setParameterNotifyingHost(TAB2OPEN, (float)synth2AccordeonTab->isExpanded());
    if (caller == envelopeEditorAccordeonTab) filter->setParameterNotifyingHost(TAB3OPEN, (float)envelopeEditorAccordeonTab->isExpanded());
    if (caller == controlAccordeonTab) filter->setParameterNotifyingHost(TAB4OPEN, (float)controlAccordeonTab->isExpanded());
}

void TalComponent::comboBoxChanged(ComboBox* caller)
{
    TalComboBox* talCaller = (TalComboBox*)caller;

    // TalCore* const filter = getProcessor();
    NamedValueSet values = talCaller->getProperties();
    if (values.contains(Identifier("index")))
    {
        TalCore* const filter = getProcessor();
        filter->setParameterNotifyingHost(values["index"], talCaller->getNormalizedSelectedId());
    }
}

